        <Route path="/employees" element={<ListEmployeeComponent />}></Route>
        <Route path="*" element={<ListEmployeeComponent />}></Route>
      </Routes>
      <FooterComponent />
      </BrowserRouter>

        </div>
        <FooterComponent />
        </Router>
    </div>
  );
}

export default App;
